import * as accountContans from '../const/account';
const initialState = {
  listAccount: [],
};
const reducer= (state = initialState, action) => {
  switch (action.type) {
    // --------------REDUCER LIST ACCOUNT-----------------
    case accountContans.FETCH_ACCOUNT: {
      return {
        ...state,
        listAccount: action.payload.data
      };
    }
    default:
      return state;
  }
};
export default reducer;
